★リーボックのイージートーン！<br>
<br>
●ファッションリーダーとして女性から絶大な支持を持つタレントの紗栄子さんとEASYTONEのコラボレーションモデル！<br>
●「日常にかわいくオシャレに履ける」シューズとして紗栄子さんが素材、カラーなど細部までこだわったシューズ！<br>
●ソールに空気の入ったポットが搭載。歩く度にポッド内の空気が流動し、まるでバランスボールの上に立っている様な状況作り出します！<br>
●空気の流動によるバランスボールエクササイズ効果＋クッショニング性！<br>
●アッパーはキャンバス素材で耐久性があり経年変化の風合いを楽しめます！<br>
●日常使いはもちろん、ドレスアップする時にもオススメです！<br>
<br>
■素材<br>
甲：合成繊維<br>
底：ゴム底<br>
■企画製造販売元 アディダスジャパン株式会社 リーボックジャパン<br>
